import React from 'react';

const CityFilter = () => {
  return (
    <div>
      <label>City:</label>
      <select>
        <option value="">All</option>
        <option value="Monterrey">Monterrey</option>
        <option value="Guadalajara">Guadalajara</option>
        <option value="Cancun">Cancun</option>
      </select>
    </div>
  );
};

export default CityFilter;
